import React from 'react';

function ServicesSection() {
  return (
    <section id="services" className="content-section">
      <h3>Наши услуги</h3>
      <p>Мы предлагаем инновационные решения для космических исследований и технологий, помогающие достичь новых высот.</p>
    </section>
  );
}

export default ServicesSection;
